import React, { Component } from "react";

class Footer extends Component {
    render() {
        return ( 
            <footer>
                <ul className = "links" >
                    <li>
                        &copy; cbellee
                    </li>
                </ul> 
            </footer>
        );
    }
}

export default Footer;
